             VALUES ("NAACL-HLT 2019", "William Yang Wang, Sameer Singh, Jiwei Li", "Deep Adversarial Learning for NLP", "Adversarial learning is a game-theoretic learning paradigm, which has achieved huge successes in the field of Computer Vision recently. Adversarial learning is also a general framework that enables a variety of learning models, including the popular Generative Adversarial Networks (GANs). Due to the discrete nature of language, designing adversarial learning models is still challenging for NLP problems. In this tutorial, we provide a gentle introduction to the foundation of deep adversarial learning, as well as some practical problem formulations and solutions in NLP. We describe recent advances in deep adversarial learning for NLP, with a special focus on generation, adversarial examples & rules, and dialogue. We provide an overview of the research area, categorize different types of adversarial learning models, and discuss pros and cons, aiming at providing some practical perspectives on the future of adversarial learning for solving real-world NLP problems.", "Greenway DE/FG", "Sunday, June 02, 2019, 9:00 – 12:30", NULL);
             VALUES ("NAACL-HLT 2019", "Samuel Bowman, Xiaodan Zhu", "Deep Learning for Natural Language Inference", "This tutorial discusses cutting-edge research on NLI, including recent advance on dataset development, cutting-edge deep learning models, and highlights from recent research on using NLI to understand capabilities and limits of deep learning models for language understanding and reasoning.", "Greenway BC/HI", "Sunday, June 02, 2019, 9:00 – 12:30", NULL);
             VALUES ("NAACL-HLT 2019", "Jacob Eisenstein", "Measuring and Modeling Language Change", "This tutorial is designed to help researchers answer the following sorts of questions:         Are people happier on the weekend?What was 1861's word of the year?Are Democrats and Republicans more different than ever?When did gay stop meaning happy?Are gender stereotypes getting weaker, stronger, or just different?Who is a linguistic leader?How can we get internet users to be more polite and objective?Such questions are fundamental to the social sciences and humanities, and scholars in these disciplines are increasingly turning to computational techniques for answers. Meanwhile, the ACL community is increasingly engaged with data that varies across time, and with the social insights that can be offered by analyzing temporal patterns and trends. The purpose of this tutorial is to facilitate this convergence in two main ways:         By synthesizing recent computational techniques for handling and modeling temporal data, such as dynamic word embeddings, the tutorial will provide a starting point for future computational research. It will also identify useful tools for social scientists and digital humanities scholars. The tutorial will provide an overview of techniques and datasets from the quantitative social sciences and the digital humanities, which are not well-known in the computational linguistics community. These techniques include vector autoregressive models, multiple comparisons corrections for hypothesis testing, and causal inference. Datasets include historical newspaper archives and corpora of contemporary political speech.", "Greenway J", "Sunday, June 02, 2019, 9:00 – 12:30", NULL);
             VALUES ("NAACL-HLT 2019", "Sebastian Ruder, Matthew Peters, Swabha Swayamdipta, Thomas Wolf", "Transfer Learning in Natural Language Processing", "The classic supervised machine learning paradigm is based on learning in isolation, a single predictive model for a task using a single dataset. This approach requires a large number of training examples and performs best for well-defined and narrow tasks. Transfer learning refers to a set of methods that extend this approach by leveraging data from additional domains or tasks to train a model with better generalization properties.Over the last two years, the field of Natural Language Processing (NLP) has witnessed the emergence of several transfer learning methods and architectures which significantly improved upon the state-of-the-art on a wide range of NLP tasks.These improvements together with the wide availability and ease of integration of these methods are reminiscent of the factors that led to the success of pretrained word embeddings and ImageNet pretraining in computer vision, and indicate that these methods will likely become a common tool in the NLP landscape as well as an important research direction.We will present an overview of modern transfer learning methods in NLP, how models are pre-trained, what information the representations they learn capture, and review examples and case studies on how these models can be integrated and adapted in downstream NLP tasks.", "Greenway DE/FG", "Sunday, June 02, 2019, 14:00 – 17:30", NULL);
             VALUES ("NAACL-HLT 2019", "Aida Nematzadeh, Richard Futrell, Roger Levy", "Language Learning and Processing in People and Machines", "The goal of this tutorial is to bring the fields of computational linguistics and computational cognitive science closer: we will introduce different stages of language acquisition and their parallel problems in NLP. As an example, one of the early challenges children face is mapping the meaning of word labels (such as 'cat') to their referents (the furry animal in the living room). Word learning is similar to the word alignment problem in machine translation. We explain the current computational models of language acquisition, their limitations, and how the insights from these models can be incorporated into NLP applications. Moreover, we discuss how we can take advantage of the cognitive science of language in computational linguistics: for example, by designing cognitively-motivated evaluation tasks or buildings language-learning inductive biases into our models.", "Greenway BC/HI", "Sunday, June 02, 2019, 14:00 – 17:30", NULL);
             VALUES ("NAACL-HLT 2019", "Yanshan Wang, Ahmad Tafti, Sunghwan Sohn, Rui Zhang", "Applications of Natural Language Processing in Clinical Research and Practice", "Rapid growth in adoption of electronic health records (EHRs) has led to an unprecedented expansion in the availability of large longitudinal datasets. Large initiatives such as the Electronic Medical Records and Genomics (eMERGE) Network, the Patient-Centered Outcomes Research Network (PCORNet), and the Observational Health Data Science and Informatics (OHDSI) consortium, have been established and have reported successful applications of secondary use of EHRs in clinical research and practice. In these applications, natural language processing (NLP) technologies have played a crucial role as much of detailed patient information in EHRs is embedded in narrative clinical documents. Meanwhile, a number of clinical NLP systems, such as MedLEE, MetaMap/MetaMap Lite, cTAKES, and MedTagger have been developed and utilized to extract useful information from diverse types of clinical text, such as clinical notes, radiology reports, and pathology reports. Success stories in applying these tools have been reported widely.Despite the demonstrated success of NLP in the clinical domain, methodologies and tools developed for the clinical NLP are still under-known and under-utilized by students and experts in the general NLP domain, mainly due to the limited exposure to EHR data. Through this tutorial, we would like to introduce NLP methodologies and tools developed in the clinical domain, and showcase the real-world NLP applications in clinical research and practice at Mayo Clinic (the No. 1 national hospital ranked by the U.S. News \& World Report) and the University of Minnesota (the No. 41 best global universities ranked by the U.S. News \& World Report). We will review NLP techniques in solving clinical problems and facilitating clinical research, the state-of-the art clinical NLP tools, and share collaboration experience with clinicians, as well as publicly available EHR data and medical resources, and finally conclude the tutorial with vast opportunities and challenges of clinical NLP. The tutorial will provide an overview of clinical backgrounds, and does not presume knowledge in medicine or health care. The goal of this tutorial is to encourage NLP researchers in the general domain (as opposed to the specialized clinical domain) to contribute to this burgeoning area.In this tutorial, we will first present an overview of clinical NLP. We will then dive into two subareas of clinical NLP in clinical research, including big data infrastructure for large-scale clinical NLP and advances of NLP in clinical research, and two subareas in clinical practice, including clinical information extraction and patient cohort retrieval using EHRs. Around 70\% of the tutorial will review clinical problems, cutting-edge methodologies, and real-world clinical NLP tools while another 30\% introduce use cases at Mayo Clinic and the University of Minnesota. Finally, we will conclude the tutorial with challenges and opportunities in this rapidly developing domain.", "Greenway J", "Sunday, June 02, 2019, 14:00 – 17:30", NULL);
            VALUES ("NAACL-HLT 2019", "SemEval", "Jonathan May, Ekaterina Shutova, Aurelie Herbelot, Xiaodan Zhu, Marianna Apidianaki, Saif M. Mohammad", "The 13th International Workshop on Semantic Evaluation is an ongoing series of evaluations of computational semantic analysis systems; it evolved from the Senseval word sense evaluation series. The evaluations are intended to explore the nature of meaning in language.Organizers: Jonathan May, Ekaterina Shutova, Aurelie Herbelot, Xiaodan Zhu, Marianna Apidianaki, and Saif M. Mohammad", NULL, NULL, "http://alt.qcri.org/semeval2019/");
            VALUES ("NAACL-HLT 2019", "*SEM", " Lun-Wei Ku, Ekaterina Shutova", "The 8th Joint Conference on Lexical and Computational Semantics brings together researchers interested in the semantics of natural languages and its computational modelling. The conference embraces symbolic and probabilistic approaches, and everything in between; theoretical contributions as well as practical applications are welcome in the form of long and short papers.General Chair: Rada Mihalcea, Program Co-Chairs: Lun-Wei Ku and Ekaterina Shutova", NULL, NULL, "https://starsem.org/2019/");
            VALUES ("NAACL-HLT 2019", "CLPsych", "Kate Niederhoffer, Kate Loveys, Philip Resnik, Rebecca Resnik, Kristy Hollingshead", "The 6th Annual Computational Linguistics and Clinical Psychology Workshop aims to bring together computational linguistics researchers with clinicians to talk about the ways that language technology can be used to improve mental and neurological health.Organizers: Kate Niederhoffer, Kate Loveys, Philip Resnik, Rebecca Resnik, and Kristy Hollingshead", NULL, NULL, "http://clpsych.org/");
            VALUES ("NAACL-HLT 2019", "DISRPT", "Amir Zeldes, Debopam Das, Erick Galani Maziero, Juliano Antonio, Mikel Iruskieta", "The Workshop on Discourse Relation Parsing and Treebanking aims to broaden the scope of discussion from previous biennial events on discourse relation studies. The goal is to include participants and program committee members from different discourse theories (especially, but not limited to, RST, SDRT and PDTB) and focus on applied papers with a computational orientation, resource papers and work on discourse parsing, as well as papers that advance the field with novel theoretical contributions and promote cross-framework fertilization.Organizers: Amir Zeldes, Debopam Das, Erick Galani Maziero, Juliano Antonio, and Mikel Iruskieta", NULL, NULL, "https://sites.google.com/view/disrpt2019/");
            VALUES ("NAACL-HLT 2019", "ESSP", "Vivi Nastase, Benjamin Roth, Laura Dietz, Andrew McCallum", "The Workshop on Extracting Structured Knowledge from Scientific Publications focuses on processing scientific articles and creating structured repositories such as knowledge graphs for finding new information and making scientific discoveries. The aim of this workshop is to identify the necessary representations for facilitating automated reasoning over scientific information, and to bring together experts in natural language processing and information extraction with scientists from other domains (e.g. material sciences, biomedical research) who want to leverage the vast amount of information stored in scientific publications.Organizers: Vivi Nastase, Benjamin Roth, Laura Dietz, and Andrew McCallum", NULL, NULL, "https://scientific-knowledge.github.io");
            VALUES ("NAACL-HLT 2019", "NeuralGen", "Antoine Bosselut, Marjan Ghazvininejad, Srinivasan Iyer, Urvashi Khandelwal, Hannah Rashkin, Asli Celikyilmaz, Thomas Wolf", "The Workshop on Methods for Optimizing and Evaluating Neural Language Generation aims to discuss new methods for language generation that address some of the recurring problems in existing language generation techniques (eg. bland, repetitive language) as well as novel techniques for robustly evaluating and interpreting model output.Organizers: Antoine Bosselut, Marjan Ghazvininejad, Srinivasan Iyer, Urvashi Khandelwal, Hannah Rashkin, Asli Celikyilmaz, and Thomas Wolf", NULL, NULL, "https://neuralgen2019.github.io");
            VALUES ("NAACL-HLT 2019", "NLP+CSS", "Svitlana Volkova, David Jurgens, Oren Tsur, Dirk Hovy, David Bamman", "The 3rd Workshop on NLP and Computational Social Science is a cross-disciplinary workshop that aims to advance the joint computational analysis of social sciences and language by explicitly involving social scientists, NLP researchers, and industry partners.Organizers: Svitlana Volkova, David Jurgens, Oren Tsur, Dirk Hovy, and David Bamman", NULL, NULL, "https://sites.google.com/site/nlpandcss/home");
            VALUES ("NAACL-HLT 2019", "RepEval", "Anna Rogers, Aleksandr Drozd, Anna Rumshisky, Yoav Goldberg", "The 3rd Workshop on Evaluating Vector Space Representations for NLP aims to encourage interdisciplinary dialogue by welcoming diverse perspectives on the issues surrounding vector-space representations: submissions may focus on properties of embedding space, performance analysis for various downstream tasks, as well as approaches based on linguistic and psychological data.Organizers: Anna Rogers, Aleksandr Drozd, Anna Rumshisky, and Yoav Goldberg", NULL, NULL, "https://repeval2019.github.io");
            VALUES ("NAACL-HLT 2019", "SiVL", "Kushal Kafle, Spandana Gella, Stefan Lee, Moin Nabi, Raffaella Bernardi, Christopher Kanan, Raquel Fernandez", "The Workshop on Shortcomings in Vision and Language aims to bring together researchers at the intersection of vision and language to discuss shortcomings of modern approaches, tasks, datasets, and evaluation metrics for problems including image and video captioning, visual question answering, visual dialog, activity recognition, image retrieval and referring expressions.Organizers: Kushal Kafle, Spandana Gella, Stefan Lee, Moin Nabi, Raffaella Bernardi, Christopher Kanan, and Raquel Fernandez", NULL, NULL, "https://sites.google.com/view/sivl2019/");
            VALUES ("NAACL-HLT 2019", "SpLU-RoboNLP", "James F. Allen, Jacob Andreas, Jason Baldridge, Mohit Bansal, Archna Bhatia, Yonatan Bisk, Asli Celikyilmaz, Bonnie J. Dorr, Parisa Kordjamshidi, Matthew Marge, Jesse Thomason.", "The Combined Workshop on Spatial Language Understanding and Grounded Communication for Robotics focuses on spatial language meaning representations, situated language grounding, and their application to robotics, HRI, learning, QA, and reasoning.Organizers: James F. Allen, Jacob Andreas, Jason Baldridge, Mohit Bansal, Archna Bhatia, Yonatan Bisk, Asli Celikyilmaz, Bonnie J. Dorr, Parisa Kordjamshidi, Matthew Marge, Jesse Thomason.", NULL, NULL, "https://splu-robonlp.github.io/");
            VALUES ("NAACL-HLT 2019", "WASSA", "Alexandra Balahur, Roman Klinger, Veronique Hoste, Carlo Strapparava, Orphee De Clercq", "The 10th Workshop on Computational Approaches to Subjectivity, Sentiment and Social Media Analysis aims to continue the line of the previous editions, bringing together researchers in Computational Linguistics working on Subjectivity and Sentiment Analysis and researchers working on interdisciplinary aspects of affect computation from text.Organizers: Alexandra Balahur, Roman Klinger, Veronique Hoste, Carlo Strapparava, and Orphee De Clercq", NULL, NULL, "https://wt-public.emm4u.eu/wassa2019/index.htm");
            VALUES ("NAACL-HLT 2019", "Clinical NLP", "Anna Rumshisky, Kirk Roberts, Steven Bethard, Tristan Naumann", "The Clinical Natural Language Processing Workshop specifically focuses on advancing state-of-the-art in clinical NLP, rather than merely applying existing NLP systems to downstream clinical problems (such as outcome prediction or clinical cohort selection).Organizers: Anna Rumshisky, Kirk Roberts, Steven Bethard, and Tristan Naumann", NULL, NULL, "https://clinical-nlp.github.io/2019/");
            VALUES ("NAACL-HLT 2019", "CMCL", "Emmanuele Chersoni, Cassandra L. Jacobs, Alessandro Lenci, Tal Linzen, Laurent Prévot, Enrico Santus", "The Workshop on Cognitive Modeling and Computational Linguistics The CMCL workshop provides a venue for computational research on cognitive theories of language processing, representation and acquisition.Organizers: Emmanuele Chersoni, Cassandra L. Jacobs, Alessandro Lenci, Tal Linzen, Laurent Prévot, and Enrico Santus", NULL, NULL, "https://cmclorg.github.io/");
            VALUES ("NAACL-HLT 2019", "CRAC", "Maciej Ogrodniczuk, Sameer Pradhan, Yulia Grishina, Vincent Ng", "The 2nd Workshop on Computational Models of Reference, Anaphora and Coreference aims to provide a forum where work on all aspects of computational work on anaphora resolution and annotation, including both coreference and types of anaphora such as bridging references resolution and discourse deixis, can be presented.Organizers: Maciej Ogrodniczuk, Sameer Pradhan, Yulia Grishina, and Vincent Ng", NULL, NULL, "https://sites.google.com/view/crac2019/");
            VALUES ("NAACL-HLT 2019", "LaTECH-ClFl", "Beatrice Alex, Stefania Degaetano-Ortlieb, Anna Kazantseva, Nils Reiter, Stan Szpakowicz", "The 3rd Joint SIGHUM Workshop on Computational Linguistics for Cultural Heritage, Social Sciences, Humanities and Literature will put in the same room two events with a similar research focus and with some tradition: the Workshops on Language Technology for Cultural Heritage, Social Sciences, and Humanities (LaTeCH) and the Workshops on Computational Linguistics for Literature (CLfL). The LaTeCH workshop series has focused on developing technologies for improved information access to data from the humanities and social sciences and the CLfL workshops have focussed on applications of NLP to literary data.Organizers: Beatrice Alex, Stefania Degaetano-Ortlieb, Anna Kazantseva, Nils Reiter, and Stan Szpakowicz", NULL, NULL, "https://sighum.wordpress.com/events/latech-clfl-2019/");
            VALUES ("NAACL-HLT 2019", "Narrative Understanding", "David Bamman, Snigdha Chaturvedi, Elizabeth Clark, Madalina Fiterau, Mohit Iyyer", "The Workshop on Narrative Understanding aims to bring together an interdisciplinary groups of researchers from AI, ML, NLP, Computer Vision and other related fields, as well as scholars from the humanities to discuss methods to improve automatic narrative understanding capabilities.Organizers: David Bamman, Snigdha Chaturvedi, Elizabeth Clark, Madalina Fiterau, and Mohit Iyyer", NULL, NULL, "https://sites.google.com/view/narrativeunderstanding/");
            VALUES ("NAACL-HLT 2019", "NLLP", "Nikolaos Aletras, Elliott Ash, Leslie Barrett, Daniel Chen, Adam Meyers, Daniel Preotiuc-Pietro, David Rosenberg, Amanda Stent", "The Workshop in Natural Legal Language Processing aims to focus attention on the applications of NLP to the wide variety of textual data in the Legal domain. We hope to stimulate interesting discussion within the community on special problems that are unique to legal texts, legal dialogue and legal knowledge resources.Organizers: Nikolaos Aletras, Elliott Ash, Leslie Barrett, Daniel Chen, Adam Meyers, Daniel Preotiuc-Pietro, David Rosenberg, and Amanda Stent", NULL, NULL, "https://sites.google.com/view/nllp/");
            VALUES ("NAACL-HLT 2019", "SLPAT", "Heidi Christensen, Kristy Hollingshead, Emily Prud’hommeaux, Frank Rudzicz, Keith Vertanen", "The Workshop on Speech and Language Processing for Assistive Technologies bring individuals from the areas of Assistive Technologies/Augmentative and Alternative Communication and Speech/NLP together with users to share research findings, and to discuss present and future challenges and the potential for collaboration and progress.Organizers: Heidi Christensen, Kristy Hollingshead, Emily Prud’hommeaux, Frank Rudzicz, and Keith Vertanen", NULL, NULL, "http://www.slpat.org");
            VALUES ("NAACL-HLT 2019", "SPNLP", "André F. T. Martins, Andreas Vlachos, Sujith Ravi, Zornitsa Kozareva, Julia Kreutzer, Vlad Niculae, Gerasimos Lampouras", "The 3rd Workshop on Structured Prediction for NLP aims to bring together NLP and ML researchers who have an interest in structured prediction due to recent advances in methods using continuous representations, being able to learn with task-level supervision, or modelling latent linguistic structure.Organizers: André F. T. Martins, Andreas Vlachos, Sujith Ravi, Zornitsa Kozareva, Julia Kreutzer, Vlad Niculae, and Gerasimos Lampouras", NULL, NULL, "http://structuredprediction.github.io/SPNLP19");
            VALUES ("NAACL-HLT 2019", "VarDial", "Marcos Zampieri, Preslav Nakov, Shervin Malmasi, Nikola Ljubešić, Jörg Tiedemann, Ahmed Ali", "The 6th Workshop on NLP for Similar Languages, Varieties and Dialects is the latest in a well-established series of workshops promoting a forum for scholars working on a range of topics related to the study of diatopic linguistic variation from a computational perspective.Organizers: Marcos Zampieri, Preslav Nakov, Shervin Malmasi, Nikola Ljubešić, Jörg Tiedemann, and Ahmed Ali", NULL, NULL, "https://sites.google.com/view/vardial2019");
            VALUES ("NAACL-HLT 2019", "When the Computers Spot the Lie (and People Don’t)", "Rada Mihalcea (University of Michigan)", "Rada Mihalcea is a Professor of Computer Science and Engineering at the University of Michigan and the Director of the Michigan Artificial Intelligence Lab. Her research interests are in lexical semantics, multilingual NLP, and computational social sciences. She serves or has served on the editorial boards of the Journals of Computational Linguistics, Language Resources and Evaluations, Natural Language Engineering, Journal of Artificial Intelligence Research, IEEE Transactions on Affective Computing, and Transactions of the Association for Computational Linguistics. She was a program co-chair for EMNLP 2009 and ACL 2011, and a general chair for NAACL 2015 and *SEM 2019. She currently serves as the ACL Vice-President Elect. She is the recipient of an NSF CAREER award (2008) and a Presidential Early Career Award for Scientists and Engineers awarded by President Obama (2009). In 2013, she was made an honorary citizen of her hometown of Cluj-Napoca, Romania.", "Whether we like it or not, deception occurs everyday and everywhere: thousands of trials take place daily around the world; little white lies: “I’m busy that day!” even if your calendar is blank; news “with a twist” (a.k.a. fake news) meant to attract the readers attention or influence people in their future undertakings; misinformation in health social media posts; portrayed identities, on dating sites and elsewhere. Can a computer automatically detect deception in written accounts or in video recordings? In this talk, I will overview a decade of research in building linguistic and multimodal resources and algorithms for deception detection, targeting deceptive statements, trial videos, fake news, identity deception, and health misinformation. I will also show how these algorithms can provide insights into what makes a good lie - and thus teach us how we can spot a liar. As it turns out, computers can be trained to identify lies in many different contexts, and they can often do it better than humans do.", "Tuesday, June 04, 2019, 14:00 – 15:00", "Nicollet Ballroom", NULL);
            VALUES ("NAACL-HLT 2019", "Leaving the Lab: Building NLP Applications that Real People can Use", "Kieran Snyder (Textio)", "Kieran Snyder is the CEO and Co-Founder of Textio, the augmented writing platform. For anything you write, Textio tells you ahead of time who’s going to respond based on the language you’ve used. Textio’s augmented writing engine is designed to attach to any large text corpus with outcomes to find the patterns that work. Prior to founding Textio, Kieran held product leadership roles at Microsoft and Amazon. Kieran has a PhD in linguistics from the University of Pennsylvania. Her work has appeared in Fortune, Re/code, Slate, and the Washington Post.", "There is a chasm between an NLP technology that works well in the research lab and something that works for applications that real people use. Research conditions are often theoretical or idealized. The first time they contribute to industry projects, many theoretical researchers are surprised to discover how much goes into building outside the lab, and how hard it is to build data products for real people ethically and transparently. This talk explores my NLP journey in three stages: working as an academic NLP researcher, learning to be a practical creator of NLP products in industry, and becoming the founding CEO of an NLP business. While each role has used my background in computational linguistics in essential ways, every step has also required me to learn and unlearn new things along the way. The further I have gone in my industry career, the more critical it has become to define and work within a well-established set of principles for data ethics. This talk is for academic researchers considering industry careers or collaborations, for people in industry who started out in academia, and for anyone on either side of the divide who wants to make NLP products that real people can use", "Wednesday, June 05, 2019, 9:00 – 10:00", "Nicollet Ballroom", NULL);
            VALUES ("NAACL-HLT 2019", "Data as a Mirror of Society: Lessons from the Emerging Science of Fairness in Machine Learning", "Arvind Narayanan (Princeton University)", "Arvind Narayanan is an Associate Professor of Computer Science at Princeton. His research has shown how state-of-the-art word embeddings reflect racial, gender, and other cultural stereotypes. He leads the Princeton Web Transparency and Accountability Project to uncover how companies collect and use our personal information. His doctoral research showed the fundamental limits of de-identification, for which he received the Privacy Enhancing Technologies Award. Narayanan also co-created a Massive Open Online Course as well as a textbook on Bitcoin and cryptocurrency technologies.", "Language corpora reflect human society, including cultural stereotypes, prejudices, and historical patterns. By default, statistical language models will absorb these stereotypes. As a result, NLP systems for word analogy generation, toxicity detection, and many other tasks have been found to reflect racial and gender biases. Based on this observation, I will discuss two emerging research directions. First, a deeper understanding of human culture can help identify possible harmful stereotypes in algorithmic systems. The second research direction is the converse of the first: if data is a mirror of society, machine learning can be used as a magnifying lens to study human culture.", "Monday, June 03, 2019, 9:30 – 10:30", "Nicollet Ballroom", NULL);

